import React from "react";
import {Title} from './Title';
import styled, { css } from 'styled-components';
const RedRectangle = styled.div`
    background: #81100B;
    border-radius: 10px;
    text-align: center;
    padding: 42px 32px;
    margin-top: 72px;
    margin-bottom: 32px;
`;
const Text = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    font-style: normal;
    font-weight: normal;
    font-size: 28px;
    letter-spacing: 0.05em;
    color: #FFFFFF;
    padding-bottom: 40px;
    ${props => props.none && css`
        padding-bottom: 0px;
    `}
`;
const Logo = styled.img`
    position: absolute;
    right: -4.3%;
    top: -7%;
    z-index: 1;
    text-align: right;
    @media only all and (max-width: 1366px) {
        right: -6%;
        top: -2%;
    }
`;
function Short_Rent_Benefits() {
    return(
        <>
        <Title/>
        <div className="row">
            <div className="col-sm-8 mx-auto">
                <RedRectangle>
                    <Logo src="./images/logo4.svg"></Logo>
                    <Text>Senza fatica e senza pensieri, da PALPONAUTO risolvi in modo immediato</Text>
                    <Text>Noleggia un giorno, un mese, un anno</Text>
                    <Text none>Come vuoi quando vuoi tu</Text>
                </RedRectangle>
            </div>
        </div>
        </>
    );
}
export {Short_Rent_Benefits};
